$(document).on("click",".single-video-status-modal",function(){let u="/admin/dashboard/galleries/video/edit/"+$(this).data("uuid");axios.get(u).then(function(i){let{data:t}=i.data.data,{status:d}=i;if(d===200){let e=$("#singleVideoStatusForm").find("[name=uuid]"),a=$("#singleVideoStatusForm").find("[name=is_active]");e?e.val(t.uuid):$("<input>").attr({type:"hidden",id:"uuid",name:"uuid",value:t.uuid}).appendTo("#singleVideoStatusForm"),a.prop("checked",t.is_active===1),$("#singleVideoStatus").modal("show")}}).catch(function(i){error(i)})});$(document).on("click","#singleVideoStatusModalButton",function(){});
